import './css/bg.css'

export default function Middle(){
    return(
        <div className='relative'>
            <div  className="w-full h-[32rem] bg-cover bg-dunes mainhall bg-no-repeat relative">
                <h1 className='text-gray-50 font-charmon text-7xl absolute top-[200px] left-20'>All path <br/> leads to Miles</h1>
            </div>
            <div className='p-20 bg-[#76C893] w-[50rem] absolute left-[500px] -translate-y-20 rounded-3xl align-top inline-block'>
            Find your perfect place in Ho Chi Minh!
            </div>
        </div>
    )

}
